import { Route, Routes } from "react-router-dom";
import SecondPage from "./SecondPage";
import ProductPageCategory from "./Product page category/ProductPageCategory";
import { Categories, ProductsPage, } from '../../Data/data'
import { useState } from "react";


const Mmnnnn = () => {
    const [cat, setCat] = useState()
    const appearCat = (Cat) => {
        const NewArray = []
        for (let i in Cat) {
            for (let f in Cat[i]) {
                for (let g in Cat[i][f]) {
                    NewArray.push(Cat[i][f][g])
                    setCat(NewArray)
                }
            }
        }
    }




    // console.log(cat)


    return (
        <div>
            {/* <button onClick={() => appearCat(Categories.Fashion)}>aaa</button> */}
            {/* <BrowserRouter> */}
            <Routes>
                <Route path='groceries' element={<SecondPage ProductsPage={ProductsPage.Supermarket} Categoties={() => appearCat(Categories.supermarket)} Cat={cat} />} />
                <Route path='fashion' element={<SecondPage ProductsPage={ProductsPage.Fashion} Categoties={() => appearCat(Categories.Fashion)} Cat={cat} />} />
                <Route path='health-beauty' element={<SecondPage ProductsPage={ProductsPage.HealthBeauty} Categoties={() => appearCat(Categories.HealthBeauty)} Cat={cat} />} />
                <Route path='baby-products' element={<SecondPage ProductsPage={ProductsPage.BabyProducts} />} />
                <Route path='phones-tablets' element={<SecondPage ProductsPage={ProductsPage.PhoneTablets} />} />

                <Route path="/food-storage" element={<ProductPageCategory />} />
                <Route path="grocerie/disposable-plates-cutlery" element={<ProductPageCategory />} />
                <Route path="grocerie/disposable-cups" element={<ProductPageCategory />} />
                <Route path="grocerie/trash-compost-lawn-bags" element={<ProductPageCategory />} />
                <Route path="grocerie/detergent" element={<ProductPageCategory />} />
                <Route path="grocerie/fabric-softner" element={<ProductPageCategory />} />
                <Route path="grocerie/stain-removal" element={<ProductPageCategory />} />
                <Route path="grocerie/air-fresheners" element={<ProductPageCategory />} />
                <Route path="grocerie/food-storage" element={<ProductPageCategory />} />
                <Route path="grocerie/Kitchen Cleaners" element={<ProductPageCategory />} />
                <Route path="grocerie/Bathroom Cleaners" element={<ProductPageCategory />} />

                <Route path="fashio/womens-bags" element={<ProductPageCategory />} />
                <Route path="fashio/dresses-jumpsuits" element={<ProductPageCategory />} />
                <Route path="fashio/hoodies-sweatshirts" element={<ProductPageCategory />} />
                <Route path="fashio/mens-casual-shirts" element={<ProductPageCategory />} />
                <Route path="fashio/t-shirts-and-polos" element={<ProductPageCategory />} />
                <Route path="fashio/men-suits" element={<ProductPageCategory />} />
                <Route path="fashio/baby-boys-fashion" element={<ProductPageCategory />} />
                <Route path="fashio/baby-girl-fashion" element={<ProductPageCategory />} />

                <Route path="HealthBeaut/oral-care" element={<ProductPageCategory />} />
                <Route path="HealthBeaut/feminine-hygiene" element={<ProductPageCategory />} />
                <Route path="HealthBeaut/shave-hair" element={<ProductPageCategory />} />
                <Route path="HealthBeaut/body-skin-care" element={<ProductPageCategory />} />
                <Route path="HealthBeaut/eyes-treament-products" element={<ProductPageCategory />} />
                <Route path="HealthBeaut/facial-care-cleansers" element={<ProductPageCategory />} />
                <Route path="HealthBeaut/styling-tools" element={<ProductPageCategory />} />
                <Route path="HealthBeaut/styling-products" element={<ProductPageCategory />} />
                <Route path="HealthBeaut/shampoo-conditioner" element={<ProductPageCategory />} />
                <Route path="HealthBeaut/wellness-relaxation" element={<ProductPageCategory />} />
                <Route path="HealthBeaut/medical-supplies-equipment" element={<ProductPageCategory />} />
            </Routes>
            {/* </BrowserRouter> */}
        </div>
    )
}
export default Mmnnnn;
